def count_possible_parking_spaces(street: str) -> int:
    street = list(street)
    length = len(street)
    for i in range(length):
        if street[i] != 'D':
            continue
        if street[i] == 'B':
            if i > 1:
                street[i] = '0'
                street[i - 1] = '0'
                street[i - 2] = '0'
            elif i == 1:
                street[i] = '0'
                street[i - 1] = '0'
        if street[i] == 'S':
            if i > 0 and i < length - 1:
                j = i
                while j + 1 < length and street[j + 1] == 'S':
                    street[j + 1] = '0'
                    j += 1
                street[j + 1] = '0'
                street[i] = '0'
                street[i - 1] = '0'
            elif i == 0:
                street[i] = '0'
                street[i + 1] = '0'
            elif i == length - 1:
                street[i] = '0'
                street[i - 1] = '0'
    return street.count('-')

